import React from "react";
import { useNavigate, useParams } from "react-router-dom";
import * as TT from "../styles/StyledTimeTable";

const TimeTable = () => {
  const navigate = useNavigate();

  const goback = () => {
    navigate(`/`);
  };

  return (
    <TT.Container>
      <TT.Header>
        <TT.Back>
          <img
            id="back"
            src={`${process.env.PUBLIC_URL}/images/Backbtn.svg`}
            alt="back"
            onClick={goback}
          />
        </TT.Back>
        <TT.Title>솜톡</TT.Title>
      </TT.Header>
      <TT.Background>
        <img
          src={`${process.env.PUBLIC_URL}/images/TimeTableBack.svg`}
          alt="background"
        />
      </TT.Background>
      <TT.Date>
        <img
          id="1001"
          src={`${process.env.PUBLIC_URL}/images/Clicked1001.svg`}
        ></img>
        <img
          id="1002"
          src={`${process.env.PUBLIC_URL}/images/unClicked1002.svg`}
        ></img>
      </TT.Date>
      <TT.Table>
        <TT.Menu>
          <TT.Menu1>
            <div id="title">부스</div>
            <div id="line1"></div>
          </TT.Menu1>
          <TT.Menu1>
            <div id="title">공연</div>
            <div id="line2"></div>
          </TT.Menu1>
        </TT.Menu>
      </TT.Table>
      <TT.Footer>
        <img src={`${process.env.PUBLIC_URL}/images/Footer.svg`} alt="footer" />
      </TT.Footer>
    </TT.Container>
  );
};

export default TimeTable;
